マスク／大人用マスク<br>●寝ている間のどにうるおいを与えるマスクです<br>●ゆず＆かりんの香りがついていて、スッキリ<br>●寝ている間、ぬれフィルターによるスチーム効果でのどにうるおいを与えるマスクです<br>●マスクのポケットにウェットフィルターをセットして使うのでマスクをつけている間、１０時間のどをうるおし続けます<br>●ウェットフィルターには、ゆず＆かりんの香りがついていて、スッキリ<br><br>商品名：小林製薬 ＊のどぬ～るぬれマスク就寝用ゆず＆かりんの香り ＜2013年秋の新製品＞  ※ 8月28日 より順次出荷予定<br>のどぬ～るぬれマスク　就寝用ゆず＆かりんの香り<br>ブランド：ヌレマスクシユウシン<br><br>●寝ている間のどにうるおいを与えるマスクです●ゆず＆かりんの香りがついていて、スッキリ<br><br> JAN：4987072031995<br>販売元：　小林製薬<br><br>CS：48<p>「のどぬーる ぬれマスク 就寝用 ゆず&amp;かりんの香り 3セット入」は、ぬれフィルターのスチーム効果でのどをうるおす、ぬれマスクです。フィルター中の水分が呼吸によって蒸気となりのどをうるおします。たっぷりの水分で、朝までうるおいが持続します。通気性不織布と特殊形状フィルターで、就寝時も楽に呼吸できます。スッキリ気持ちいい、ゆず＆かりんの香り。<br><br>使用方法<br>(1)ぬれフィルターをアルミ袋から取り出し、凹部を上にしてマスクの内側のポケットに入れてください。※日中でもご使用いただけます。<br>(2)ノーズフィットワイヤーを鼻にフィットさせマスクのポケット側を口に当て、装着してください。<br>(3)縦にマスクを伸ばして、あごまで覆うように広げてください。<br><br>使用上の注意<br>●衛生上および機能上、マスクとぬれフィルターの使用は1回限りとし、再使用しない。<br>●ぬれフィルターは使用直前に開封する。<br>●乳幼児や呼吸器に異常のある方には使用しない。<br>●肌に傷、はれもの、湿しんなど異常のある場合は使用しない。<br>●使用中や使用後に赤み、はれ、かゆみ、刺激などの異常があらわれた場合は使用を中止する。<br>●有毒な粉塵・ガス等を防ぐ目的では使用しない。<br>●マスクのニオイで気分が悪くなったり、息苦しくなった場合は使用を中止する。<br>●乳幼児の手の届かないところに保管する。<br>●自らの意思により本品を着脱することができない方は使用しない。<br><br>品質表示<br>●対象：風邪・乾燥等<br>●素材：本体/ポリプロピレン、耳ゴム/ポリエステル・ポリウレタン、ぬれフィルター/パルプ・レーヨン・ポリエチレン<br><br>原産国<br>マスク：中国　ぬれフィルター：日本</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
